import React from "react";
import "./card.css";
const Card = (props) => {
  return (
    <div className="bg-light-green dib br3 ma2 grow bw2 shadow-5">
      <img alt="robots" src="https://robohash.org/test?200*200" />
      <div>
        <h2>{props.className}</h2>
        <p>{props.email}</p>
      </div>
    </div>
  );
};
export default Card;
